import { TextField } from '@material-ui/core';
import React, { useState } from 'react';


const Name = () => {
  const [name,setName] = useState('')
  const handleName = (e) => {
    let updatedName = e.target.value
    setName(updatedName)
  }

  return (
  <div>
    <p>{name}</p>
    <TextField 
      id ="name-basic"
      label="Name"
      onChange = {handleName}
    />
  </div>
  )  
}

export default Name
